TRANSFORMFIELD.EXPRESSION:
IIF(GET_DATE_PART(DSPN_DT, 'MM') < 10
	, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '0' || TO_CHAR(GET_DATE_PART              (DSPN_DT, 'MM'))) 
	, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY')) || TO_CHAR(GET_DATE_PART              (DSPN_DT, 'MM'))) )


// format - 'YYYYMM' - If 'MM' < 10 , then append 0.
//e.g. 200901 - January 2009.

DECODE(GET_DATE_PART(DSPN_DT, 'MM'), 
                         1, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '1') ,
                         2, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '1') ,
                         3, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '1') ,
                         4, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '2') ,
                         5, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '2') ,
                         6, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '2') ,
                         7, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '3') ,
                         8, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '3') ,
                         9, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '3') ,
                       10, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '4') ,
                       11, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '4') ,
                       12, TO_Integer(TO_CHAR(GET_DATE_PART(DSPN_DT, 'YYYY'))  || '4' || '4')
                     )

// format - 'YYYY4Q'
//e.g. 200941 - Jan 2009.
//e.g. 200941 - Feb 2009.
//e.g. 200941 - Mar 2009.
//e.g. 200942 - Apr 2009.
//e.g. 200942 - May 2009.
//e.g. 200942 - Jun 2009.
//e.g. 200943 - Jul 2009.
//e.g. 200943 - Aug 2009.
//e.g. 200943 - Sept 2009.
//e.g. 200944 - Oct 2009.
//e.g. 200944 - Nov 2009.
//e.g. 200944 - Dec 2009.
